import { useCallback, useEffect, useState } from 'react';
import MineGrid from './MineGrid/MineGrid';
import './MineMaster.css'

export default function MineMaster() {
  return (
    <div>
      <div className='background-switch'>
        <div className='switch-button'>
          <div className='spot left' />
          <div className='spot right' />
          <div className='spot below' />
          <div className='star blink' />
          <div className='st1 star blink' />
          <div className='st2 star blink' />
          <div className='st3 star blink' />
          <div className='st2 star blink' />
        </div>
      </div>
      <MineGrid />
    </div>
  );
}
